package contact.model.vo;

public class Emp {
	private int empNo;
	private String empId;
	private String empPw;
	private String empName;
	private int empGrade;
	private String empGender;
	private String empPhone;
	private int empStore;
	private String empEnter;
	private String filename;
	private String filepath;
	private String empJob;
	private String empAddr;
	public Emp() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Emp(int empNo, String empId, String empPw, String empName, int empGrade, String empGender, String empPhone,
			int empStore, String empEnter, String filename, String filepath, String empJob, String empAddr) {
		super();
		this.empNo = empNo;
		this.empId = empId;
		this.empPw = empPw;
		this.empName = empName;
		this.empGrade = empGrade;
		this.empGender = empGender;
		this.empPhone = empPhone;
		this.empStore = empStore;
		this.empEnter = empEnter;
		this.filename = filename;
		this.filepath = filepath;
		this.empJob = empJob;
		this.empAddr = empAddr;
	}
	public int getEmpNo() {
		return empNo;
	}
	public void setEmpNo(int empNo) {
		this.empNo = empNo;
	}
	public String getEmpId() {
		return empId;
	}
	public void setEmpId(String empId) {
		this.empId = empId;
	}
	public String getEmpPw() {
		return empPw;
	}
	public void setEmpPw(String empPw) {
		this.empPw = empPw;
	}
	public String getEmpName() {
		return empName;
	}
	public void setEmpName(String empName) {
		this.empName = empName;
	}
	public int getEmpGrade() {
		return empGrade;
	}
	public void setEmpGrade(int empGrade) {
		this.empGrade = empGrade;
	}
	public String getEmpGender() {
		return empGender;
	}
	public void setEmpGender(String empGender) {
		this.empGender = empGender;
	}
	public String getEmpPhone() {
		return empPhone;
	}
	public void setEmpPhone(String empPhone) {
		this.empPhone = empPhone;
	}
	public int getEmpStore() {
		return empStore;
	}
	public void setEmpStore(int empStore) {
		this.empStore = empStore;
	}
	public String getEmpEnter() {
		return empEnter;
	}
	public void setEmpEnter(String empEnter) {
		this.empEnter = empEnter;
	}
	public String getFilename() {
		return filename;
	}
	public void setFilename(String filename) {
		this.filename = filename;
	}
	public String getFilepath() {
		return filepath;
	}
	public void setFilepath(String filepath) {
		this.filepath = filepath;
	}
	public String getEmpJob() {
		return empJob;
	}
	public void setEmpJob(String empJob) {
		this.empJob = empJob;
	}
	public String getEmpAddr() {
		return empAddr;
	}
	public void setEmpAddr(String empAddr) {
		this.empAddr = empAddr;
	}
	
	
	
	
}
